const Home_Garden =()=>{
    return(
        <div className="Home_Garden">
            <Nav/>
            <div className="nav-home">
                <a  id="nava" href="http://localhost:3000/">Home</a>
                <a  id="nava" href="http://localhost:3000/Electronics">Electronics</a>
                <a  id="nava" href="http://localhost:3000/Home_Garden">Home & Garden</a>
            </div>
        </div>
    )
}
export default Home_Garden;
